import React from 'react';
import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";
import ProjectCard from './ProjectCard';
import projectData from './projectData';
import ProjectDescription from './ProjectDescription';
function Projects(){
    const projects = projectData.map(proj => <ProjectCard key={proj.id} title={proj.title} image={proj.image}/>);

    return(
    <div class="row projectsContent">
        {projects}
        <br></br>
        <a class="btn btn-outline-success">1</a>
        <a class="btn btn-outline-success">2</a>
        <a class="btn btn-outline-success">3</a>
    </div>





    );


}



export default Projects;
